import React from "react";
import { MDBCol, MDBIcon } from "mdbreact";

const SearchBar = () => {
  return (
    <div style={{display:"flex", justifyContent:"center", alignItems:"center", width:"900px"}}>
        <MDBCol md="10" style={{width:"600px", height:"50px"}}>
            <form className="form-inline mt-4 mb-4" style={{width:"600px", height:"50px"}}>
                <MDBIcon icon="search" style={{width:"50px"}}/>
                <input style={{width:"600px", height:"50px"}} className="form-control form-control-lg " type="text" placeholder="Search" aria-label="Search" />
            </form>
        </MDBCol>
    </div>
  );
}

export default SearchBar;
